import React from "react";
import AnimeSidebar from "../components/sidebars/AnimeSidebar";
import Navbar from "../components/navbar/Navbar";

const AnimeHome = () => {
  return (
    <div>
      <Navbar></Navbar>
      <AnimeSidebar></AnimeSidebar>
      <div>this is test</div>
    </div>
  );
};

export default AnimeHome;
